import React from 'react'
import {Lottie, Text} from '../../atoms'
import * as Notfound from '../../../assets/lottiefiles/404.json'

const NotFound  = ({title}) => {

    return (
        <>
            <Lottie path={Notfound.default}/>
            <Text>{title}</Text>
        </>
    )
}

export default NotFound
